import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles/Header.css';
import './styles/Footer.css';
import './styles/UploadCard.css';
import './styles/SummaryResultsCard.css';
import './styles/PropertyListCard.css';
import './styles/ScatterGraphCard.css';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
